        <div className='card text-white bg-success mb-3'>
            <div className='card-header'>
                Precio del Bitcoin en Ars
            </div>
            <div className='card-body'>
                <h4 className='card-title'>Precio actual: ${price}</h4>
                <div>
                    <p className='card-text'><span className='font-weight-bold'>Uiltima hora: % {percent_change_1h}</span></p>
                </div>
                <div>
                    <p className='card-text'><span className='font-weight-bold'>Uiltimas 24hs: % {percent_change_24h}</span></p>
                </div>
                <div>
                    <p className='card-text'><span className='font-weight-bold'>Uiltimos 7 d√≠as: % {percent_change_7d}</span></p>
                </div>
            </div>
        </div>
    );
}

export default BitcoinPrice;
